import Cookies from 'universal-cookie';
import { useChatContext, ChannelList } from 'stream-chat-react'
import { Groups, PreList } from './'; 
import icon1 from '../Stuff/icon1.png'
import icon2 from '../Stuff/icon2.png'

var ListHeaderStyle = {
    color: 'red',
    padding: "0 20px",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center"

  };

var titleStyle = {
    fontFamily: "sans-serif",
    fontStyle: "normal",
    fontWeight: "bold",
    fontSize: "18px",
    lineHeight: "28px",
}

var ListHeader = () => (
    <div style={ListHeaderStyle}>
        <p style={titleStyle} >Groups:</p>

    </div>
)

var IconsHolder = () => (
    <div className="icon_side_container">
        <div className="icon1">
            <img className ='iconimg1' src={icon1} alt="appIcon" width="30"/>
        </div>
        <div className="icon2">
            <img className='iconimg2' src={icon2} alt="LogoutIcon" width="30"/>
        </div>
    </div>
)



function GroupList(){
    return (
        <>
           <IconsHolder />
            <div className =""> 
               <ListHeader /> 
            </div>
        </>
    )
}

export default GroupList
